eak password";s:15:"gettext_context";s:0:"";}i:344;O:8:"stdClass":6:{s:2:"id";s:5:"12959";s:6:"status";N;s:3:"ctx";s:32:"77797b766147ccaae4e9e45ed9deb957";s:10:"translated";N;s:8:"original";s:8:"Sessions";s:15:"gettext_context";s:0:"";}i:345;O:8:"stdClass":6:{s:2:"id";s:5:"12960";s:6:"status";N;s:3:"ctx";s:32:"1833ed4c8efcb9e5e99a51748a0c657a";s:10:"translated";N;s:8:"original";s:23:"Log Out Everywhere Else";s:15:"gettext_context";s:0:"";}i:346;O:8:"stdClass":6:{s:2:"id";s:5:"12961";s:6:"status";N;s:3:"ctx";s:32:"9e331962e72752290d49e097f348e3a0";s:10:"translated";N;s:8:"original";s:135:"Did you lose your phone or leave your account logged in at a public computer? You can log out everywhere else, and stay logged in here.";s:15:"gettext_context";s:0:"";}i:347;O:8:"stdClass":6:{s:2:"id";s:5:"12970";s:6:"status";N;s:3:"ctx";s:32:"0aa3c7eb43a1afecb81d58f2143c7029";s:10:"translated";N;s:8:"original";s:23:"Additional Capabilities";s:15:"gettext_context";s:0:"";}i:348;O:8:"stdClass":6:{s:2:"id";s:5:"12971";s:6:"status";N;s:3:"ctx";s:32:"d18b8f49d888b1f57acdaf6891af0987";s:10:"translated";N;s:8:"original";s:12:"Capabilities";s:15:"gettext_context";s:0:"";}i:349;O:8:"stdClass":6:{s:2:"id";s:5:"12972";s:6:"status";N;s:3:"ctx";s:32:"e2e4c8e8982a5921e05caa656427efc0";s:10:"translated";N;s:8:"original";s:14:"Update Profile";s:15:"gettext_context";s:0:"";}i:350;O:8:"stdClass":6:{s:2:"id";s:5:"12975";s:6:"status";N;s:3:"ctx";s:32:"bae481ceb185ad1cb8405d28200162d6";s:10:"translated";N;s:8:"original";s:117:"This screen provides access to all of your posts. You can customize the display of this screen to suit your workflow.";s:15:"gettext_context";s:0:"";}i:351;O:8:"stdClass":6:{s:2:"id";s:5:"12976";s:6:"status";N;s:3:"ctx";s:32:"899b6354a84dd315cb1640de83ba7570";s:10:"translated";N;s:8:"original";s:14:"Screen Content";s:15:"gettext_context";s:0:"";}i:352;O:8:"stdClass":6:{s:2:"id";s:5:"12977";s:6:"status";N;s:3:"ctx";s:32:"7ed2cb9c4a7f52993516725cd5168e1c";s:10:"translated";N;s:8:"original";s:82:"You can customize the display of this screen&#8217;s contents in a number of ways:";s:15:"gettext_context";s:0:"";}i:353;O:8:"stdClass":6:{s:2:"id";s:5:"12978";s:6:"status";N;s:3:"ctx";s:32:"767d49624cffb7efeb180fe4bdd5e07a";s:10:"translated";N;s:8:"original";s:123:"You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.";s:15:"gettext_context";s:0:"";}i:354;O:8:"stdClass":6:{s:2:"id";s:5:"12979";s:6:"status";N;s:3:"ctx";s:32:"014d2d802fc8f834f23987d4b037d30a";s:10:"translated";N;s:8:"original";s:165:"You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.";s:15:"gettext_context";s:0:"";}i:355;O:8:"stdClass":6:{s:2:"id";s:5:"12980";s:6:"status";N;s:3:"ctx";s:32:"186aa98f7201ceb39e7ebc98f6e8a5ae";s:10:"translated";N;s:8:"original";s:90:"You can view posts in a simple title list or with an excerpt using the Screen Options tab.";s:15:"gettext_context";s:0:"";}i:356;O:8:"stdClass":6:{s:2:"id";s:5:"12981";s:6:"status";N;s:3:"ctx";s:32:"392e9b74ecaedf4daa058dcc790516c4";s:10:"translated";N;s:8:"original";s:289:"You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.";s:15:"gettext_context";s:0:"";}i:357;O:8:"stdClass":6:{s:2:"id";s:5:"12982";s:6:"status";N;s:3:"ctx";s:32:"a3fa5d45dca47859e6e25303d750fba0";s:10:"translated";N;s:8:"original";s:17:"Available Actions";s:15:"gettext_context";s:0:"";}i:358;O:8:"stdClass":6:{s:2:"id";s:5:"12983";s:6:"status";N;s:3:"ctx";s:32:"fec1189b4b1f2a26e07f6552c036bacd";s:10:"translated";N;s:8:"original";s:138:"Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:";s:15:"gettext_context";s:0:"";}i:359;O:8:"stdClass":6:{s:2:"id";s:5:"12984";s:6:"status";N;s:3:"ctx";s:32:"74deb9541548900791736df7e47727d1";s:10:"translated";N;s:8:"original";s:130:"<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.";s:15:"gettext_context";s:0:"";}i:360;O:8:"stdClass":6:{s:2:"id";s:5:"12985";s:6:"status";N;s:3:"ctx";s:32:"aec7db39f9755f7c2dc6e2b37c8412c2";s:10:"translated";N;s:8:"original";s:145:"<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.";s:15:"gettext_context";s:0:"";}i:361;O:8:"stdClass":6:{s:2:"id";s:5:"12986";s:6:"status";N;s:3:"ctx";s:32:"fb4aa500e080edf20572554e14786e36";s:10:"translated";N;s:8:"original";s:125:"<strong>Trash</strong> removes your post from this list and places it in the trash, from which you can permanently delete it.";s:15:"gettext_context";s:0:"";}i:362;O:8:"stdClass":6:{s:2:"id";s:5:"12987";s:6:"status";N;s:3:"ctx";s:32:"feb9ddd4b67850aee6a2151805f1dfa8";s:10:"translated";N;s:8:"original";s:209:"<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.";s:15:"gettext_context";s:0:"";}i:363;O:8:"stdClass":6:{s:2:"id";s:5:"12988";s:6:"status";N;s:3:"ctx";s:32:"95e6f8b591af95b7e141df1318db45fb";s:10:"translated";N;s:8:"original";s:204:"You can also edit or move multiple posts to the trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk Actions menu and click Apply.";s:15:"gettext_context";s:0:"";}i:364;O:8:"stdClass":6:{s:2:"id";s:5:"12989";s:6:"status";N;s:3:"ctx";s:32:"d70e008926f797f7fa73820eeb9729d4";s:10:"translated";N;s:8:"original";s:214:"When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.";s:15:"gettext_context";s:0:"";}i:365;O:8:"stdClass":6:{s:2:"id";s:5:"12990";s:6:"status";N;s:3:"ctx";s:32:"c56c15933e637e8e327ecf6e6ef16e20";s:10:"translated";N;s:8:"original";s:102:"<a href="https://codex.wordpress.org/Posts_Screen" target="_blank">Documentation on Managing Posts</a>";s:15:"gettext_context";s:0:"";}i:366;O:8:"stdClass":6:{s:2:"id";s:5:"12991";s:6:"status";N;s:3:"ctx";s:32:"ce4dce9dfa5e02ec4268924fe49f9600";s:10:"translated";N;s:8:"original";s:9:"View Mode";s:15:"gettext_context";s:0:"";}i:367;O:8:"stdClass":6:{s:2:"id";s:5:"12992";s:6:"status";N;s:3:"ctx";s:32:"c3a4f87ce11230cca3ac6697df93db80";s:10:"translated";N;s:8:"original";s:37:"Draft <span class="count">(%s)</span>";s:15:"gettext_context";s:0:"";}i:368;O:8:"stdClass":6:{s:2:"id";s:5:"12993";s:6:"status";N;s:3:"ctx";s:32:"473d648331018ac18f0a33ac0967b160";s:10:"translated";N;s:8:"original";s:18:"Filter by category";s:15:"gettext_context";s:0:"";}i:369;O:8:"stdClass":6:{s:2:"id";s:5:"12994";s:6:"status";N;s:3:"ctx";s:32:"3755928e8215c4316052f26bf777074b";s:10:"translated";N;s:8:"original";s:2:", ";s:15:"gettext_context";s:0:"";}i:370;O:8:"stdClass":6:{s:2:"id";s:5:"12995";s:6:"status";N;s:3:"ctx";s:32:"8de06637f2b6a2592b12c3ce00583a45";s:10:"translated";N;s:8:"original";s:11:"Allow Pings";s:15:"gettext_context";s:0:"";}i:371;O:8:"stdClass":6:{s:2:"id";s:5:"12996";s:6:"status";N;s:3:"ctx";s:32:"7ed7e44d85807ee66d7a7777939e5d82";s:10:"translated";N;s:8:"original";s:21:"Make this post sticky";s:15:"gettext_context";s:0:"";}i:372;O:8:"stdClass":6:{s:2:"id";s:5:"12997";s:6:"status";N;s:3:"ctx";s:32:"6d2b49ee8d54a416081f83ad4c29f197";s:10:"translated";N;s:8:"original";s:5:"Pings";s:15:"gettext_context";s:0:"";}i:373;O:8:"stdClass":6:{s:2:"id";s:5:"12998";s:6:"status";N;s:3:"ctx";s:32:"61294b47c84a3c4dc9c71c428571204c";s:10:"translated";