s:2:"id";s:5:"13262";s:6:"status";N;s:3:"ctx";s:32:"fe3bd540eb74778a598238b253f74c86";s:10:"translated";N;s:8:"original";s:487:"Press This is a bookmarklet that makes it easy to blog about something you come across on the web. You can use it to just grab a link, or to post an excerpt. Press This will even allow you to choose from images included on the page and use them in your post. Just drag the Press This link on this screen to your bookmarks bar in your browser, and you&#8217;ll be on your way to easier content creation. Clicking on it while on another website opens a popup window with all these options.";s:15:"gettext_context";s:0:"";}i:384;O:8:"stdClass":6:{s:2:"id";s:5:"13263";s:6:"status";N;s:3:"ctx";s:32:"40ef29ade9db93dd527862ec4b95c9e9";s:10:"translated";N;s:8:"original";s:29:"Categories and Tags Converter";s:15:"gettext_context";s:0:"";}i:385;O:8:"stdClass":6:{s:2:"id";s:5:"13264";s:6:"status";N;s:3:"ctx";s:32:"e90a19994fd4faf5fab54f4358835df1";s:10:"translated";N;s:8:"original";s:241:"Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.";s:15:"gettext_context";s:0:"";}i:386;O:8:"stdClass":6:{s:2:"id";s:5:"13265";s:6:"status";N;s:3:"ctx";s:32:"73e9ba17e991f5898b5f2b0737c9ad4c";s:10:"translated";N;s:8:"original";s:318:"The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.";s:15:"gettext_context";s:0:"";}i:387;O:8:"stdClass":6:{s:2:"id";s:5:"13266";s:6:"status";N;s:3:"ctx";s:32:"3803641894e82a3bc63004a049535b0a";s:10:"translated";N;s:8:"original";s:93:"<a href="https://codex.wordpress.org/Tools_Screen" target="_blank">Documentation on Tools</a>";s:15:"gettext_context";s:0:"";}i:388;O:8:"stdClass":6:{s:2:"id";s:5:"13267";s:6:"status";N;s:3:"ctx";s:32:"950810cab5d955bbb097b8fbf9beaa3a";s:10:"translated";N;s:8:"original";s:94:"Press This is a little tool that lets you grab bits of the web and create new posts with ease.";s:15:"gettext_context";s:0:"";}i:389;O:8:"stdClass":6:{s:2:"id";s:5:"13268";s:6:"status";N;s:3:"ctx";s:32:"7d17dbbe8d42814301f7a0be3dd88d5c";s:10:"translated";N;s:8:"original";s:167:"Use Press This to clip text, images and videos from any web page. Then edit and add more straight from Press This before you save or publish it in a post on your site.";s:15:"gettext_context";s:0:"";}i:390;O:8:"stdClass":6:{s:2:"id";s:5:"13269";s:6:"status";N;s:3:"ctx";s:32:"5b702ab015426c9473939f27ffc8efd6";s:10:"translated";N;s:8:"original";s:18:"Install Press This";s:15:"gettext_context";s:0:"";}i:391;O:8:"stdClass":6:{s:2:"id";s:5:"13270";s:6:"status";N;s:3:"ctx";s:32:"8940620ef1f6607d183985520677250c";s:10:"translated";N;s:8:"original";s:11:"Bookmarklet";s:15:"gettext_context";s:0:"";}i:392;O:8:"stdClass":6:{s:2:"id";s:5:"13271";s:6:"status";N;s:3:"ctx";s:32:"627ef8cf75e0fe5c16d66ce6efc68e82";s:10:"translated";N;s:8:"original";s:133:"Drag the bookmarklet below to your bookmarks bar. Then, when you&#8217;re on a page you want to share, simply &#8220;press&#8221; it.";s:15:"gettext_context";s:0:"";}i:393;O:8:"stdClass":6:{s:2:"id";s:5:"13272";s:6:"status";N;s:3:"ctx";s:32:"ca60b65785eedc80e857bbeaca527e4c";s:10:"translated";N;s:8:"original";s:46:"Copy &#8220;Press This&#8221; bookmarklet code";s:15:"gettext_context";s:0:"";}i:394;O:8:"stdClass":6:{s:2:"id";s:5:"13273";s:6:"status";N;s:3:"ctx";s:32:"0c25eb55559fa3099edf02d76f1acafa";s:10:"translated";N;s:8:"original";s:165:"If you can&#8217;t drag the bookmarklet to your bookmarks, copy the following code and create a new bookmark. Paste the code into the new bookmark&#8217;s URL field.";s:15:"gettext_context";s:0:"";}i:395;O:8:"stdClass":6:{s:2:"id";s:5:"13274";s:6:"status";N;s:3:"ctx";s:32:"dfc1ee84ef583a9d23ad6de1423fca5e";s:10:"translated";N;s:8:"original";s:29:"Direct link (best for mobile)";s:15:"gettext_context";s:0:"";}i:396;O:8:"stdClass":6:{s:2:"id";s:5:"13275";s:6:"status";N;s:3:"ctx";s:32:"81b06074340feb87da4102def8cc915f";s:10:"translated";N;s:8:"original";s:96:"Follow the link to open Press This. Then add it to your device&#8217;s bookmarks or home screen.";s:15:"gettext_context";s:0:"";}i:397;O:8:"stdClass":6:{s:2:"id";s:5:"13276";s:6:"status";N;s:3:"ctx";s:32:"4d72c1440bcaa7fcd1dbba7df97c6560";s:10:"translated";N;s:8:"original";s:15:"Open Press This";s:15:"gettext_context";s:0:"";}i:398;O:8:"stdClass":6:{s:2:"id";s:5:"13361";s:6:"status";N;s:3:"ctx";s:32:"080aa02cd14d37db7557900b63234778";s:10:"translated";N;s:8:"original";s:9:"Last page";s:15:"gettext_context";s:0:"";}i:399;O:8:"stdClass":6:{s:2:"id";s:5:"13384";s:6:"status";N;s:3:"ctx";s:32:"afc5f89ef6699482945968e2d21b22bc";s:10:"translated";N;s:8:"original";s:108:"https://global.mubashertrade.com/wp-admin/post.php?post=21&amp;action=edit&amp;lang=en&wpb_vc_js_status=true";s:15:"gettext_context";s:0:"";}i:400;O:8:"stdClass":6:{s:2:"id";s:5:"13410";s:6:"status";N;s:3:"ctx";s:32:"58e0f4bd0db3f201181a24e22518af6b";s:10:"translated";N;s:8:"original";s:194:"You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.";s:15:"gettext_context";s:0:"";}i:401;O:8:"stdClass":6:{s:2:"id";s:5:"13411";s:6:"status";N;s:3:"ctx";s:32:"4d97505e61693c0a1aac1b958fe094ac";s:10:"translated";N;s:8:"original";s:382:"What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.";s:15:"gettext_context";s:0:"";}i:402;O:8:"stdClass":6:{s:2:"id";s:5:"13412";s:6:"status";N;s:3:"ctx";s:32:"8348240c846a4cb879a67a7a1e6818ca";s:10:"translated";N;s:8:"original";s:85:"When adding a new category on this screen, you&#8217;ll fill in the following fields:";s:15:"gettext_context";s:0:"";}i:403;O:8:"stdClass":6:{s:2:"id";s:5:"13413";s:6:"status";N;s:3:"ctx";s:32:"5febbe59b4e8c2b38e143b3cff8ae190";s:10:"translated";N;s:8:"original";s:70:"<strong>Name</strong> &mdash; The name is how it appears on your site.";s:15:"gettext_context";s:0:"";}i:404;O:8:"stdClass":6:{s:2:"id";s:5:"13414";s:6:"status";N;s:3:"ctx";s:32:"97af8d8b956434fb602f37b6e0e53e27";s:10:"translated";N;s:8:"original";s:170:"<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.";s:15:"gettext_context";s:0:"";}i:405;O:8:"stdClass":6:{s:2:"id";s:5:"13415";s:6:"status";N;s:3:"ctx";s:32:"eec619c60b3b0a3e38f0069c120d2602";s:10:"translated";N;s:8:"original";s:269:"<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.";s:15:"gettext_context";s:0:"";}i:406;O:8:"stdClass":6:{s:2:"id";s:5:"13416";s:6:"status";N;s:3:"ctx";s:32:"bf0e83818cfea660dd6082860a6da784";s:10:"translated";N;s:8:"original";s:118:"<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.";s:15:"gettext_context";s:0:"";}i:407;O:8:"stdClass":6:{s:2:"id";s:5:"13417";s:6:"status";N;s:3:"ctx";s:32:"59cf444b48715208ad794a188fdb27a3";s:10:"translated";N;s:8:"original";s:159:"You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.";s:15:"gettext_context";s:0:"";}i:408;O:8:"stdClass":6:{s:2:"id";s:5:"13418";s:6:"status";N;s:3:"ctx";s:32:"e8d8a9c948afa198effafc6abc6c7516";s:10:"translated";N;s:8:"original";s:17:"Adding Categories";s:15:"gettext_context";s:0:"";}i:409;O:8:"stdClass":6:{s:2:"id";s:5:"13419";s:6:"status";N;s:3:"ctx";s:32:"9e829a89e983f7c1a17dff7f9c93f5cd";s:10:"translated";N;s:8:"original";s:109:"<a href="https://codex.wordpress.org/Posts_Categories_Screen" target="_blank">Documentation on Categories</a>";s:15:"gettext_context";s:0:"";}i:410;O:8:"stdClass":6:{s:2:"id";s:5:"13420";s:6:"status";N;s:3:"ctx";s:32:"02b4ec394513fa804d000c7d0b3969ac";s:10:"translated";N;s:8:"original";s:4:"Name";s:15:"gettext_context";s:9:"term name";}i:411;O:8:"stdClass":6:{s:2:"id";s:5:"13421";s:6:"status";N;s:3:"ctx";s:32:"cbc9742faeb50eb6ad78f50ccdaa8b68";s:10:"translated";N;s:8:"original";s:5:"Count";s:15:"gettext_context";s:21:"Number/count of items";}i:412;O:8:"stdClass":6:{s:2:"id";s:5:"13422";s:6:"status";N;s:3:"ctx";s:32:"585f165889ede6fa26235251863f4bf3";s:10:"translated";N;s:8:"original";s:11:"Item added.";s:15:"gettext_context";s:0:"";}i:413;O:8:"stdClass":6:{s:2:"id";s:5:"13423";s:6:"status";N;s:3:"ctx";s:32:"c7e10a26389c7f7f3b7142eabfb58a4b";s:10:"translated";N;s:8:"original";s:13:"Item deleted.";s:15:"gettext_context";s:0:"";}i:414;O:8:"stdClass":6:{s:2:"id";s:5:"13424";s:6:"status";N;s:3:"ctx";s:32:"a5033bf4b8814de6aa95f1b1b73c9d15";s:10:"translated";N;s:8:"original";s:13:"Item updated.";s:15:"gettext_context";s:0:"";}i:415;O:8:"stdClass":6:{s:2:"id";s:5:"13425";s:6:"status";N;s:3:"ctx";s:32:"31f9e0cb44db99863f7da393ab3ad2de";s:10:"translated";N;s:8:"original";s:15:"Item not added.";s:15:"gettext_context";s:0:"";}i:416;O:8:"stdClass":6:{s:2:"id";s:5:"13426";s:6:"status";N;s:3:"ctx";s:32:"f1038881dc887dfa6af55edb0dfd36e3";s:10:"translated";N;s:8:"original";s:17:"Item not updated.";s:15:"gettext_context";s:0:"";}i:417;O:8:"stdCl