:6:{s:2:"id";s:5:"13437";s:6:"status";N;s:3:"ctx";s:32:"b6025aef255a138df8926919f435c04a";s:10:"translated";N;s:8:"original";s:14:"Tag not added.";s:15:"gettext_context";s:0:"";}i:428;O:8:"stdClass":6:{s:2:"id";s:5:"13438";s:6:"status";N;s:3:"ctx";s:32:"85cedf0a3ed1b791e0fe706df68005d5";s:10:"translated";N;s:8:"original";s:16:"Tag not updated.";s:15:"gettext_context";s:0:"";}i:429;O:8:"stdClass":6:{s:2:"id";s:5:"13439";s:6:"status";N;s:3:"ctx";s:32:"58a6e3e6c79a5296fa15a11a44c8a949";s:10:"translated";N;s:8:"original";s:13:"Tags deleted.";s:15:"gettext_context";s:0:"";}i:430;O:8:"stdClass":6:{s:2:"id";s:5:"13440";s:6:"status";N;s:3:"ctx";s:32:"7475f37e7f96f721d6705775359648a2";s:10:"translated";N;s:8:"original";s:40:"The name is how it appears on your site.";s:15:"gettext_context";s:0:"";}i:431;O:8:"stdClass":6:{s:2:"id";s:5:"13441";s:6:"status";N;s:3:"ctx";s:32:"c84042caac8257ad95bc00faf92e0b6f";s:10:"translated";N;s:8:"original";s:140:"The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.";s:15:"gettext_context";s:0:"";}i:432;O:8:"stdClass":6:{s:2:"id";s:5:"13442";s:6:"status";N;s:3:"ctx";s:32:"b5cbe62ffeca9b159d18c100ef3bb296";s:10:"translated";N;s:8:"original";s:6:"Parent";s:15:"gettext_context";s:11:"term parent";}i:433;O:8:"stdClass":6:{s:2:"id";s:5:"13443";s:6:"status";N;s:3:"ctx";s:32:"eca83cec51d51a36d40d677c793520b2";s:10:"translated";N;s:8:"original";s:160:"Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.";s:15:"gettext_context";s:0:"";}i:434;O:8:"stdClass":6:{s:2:"id";s:5:"13444";s:6:"status";N;s:3:"ctx";s:32:"4d7aff344d157ca85bba08f7fc5d35de";s:10:"translated";N;s:8:"original";s:78:"The description is not prominent by default; however, some themes may show it.";s:15:"gettext_context";s:0:"";}i:435;O:8:"stdClass":6:{s:2:"id";s:5:"13446";s:6:"status";N;s:3:"ctx";s:32:"9ca015cc0d613ce90d42fee9a1854d3f";s:10:"translated";N;s:8:"original";s:23:"Delete &#8220;%s&#8221;";s:15:"gettext_context";s:0:"";}i:436;O:8:"stdClass":6:{s:2:"id";s:5:"13447";s:6:"status";N;s:3:"ctx";s:32:"477cea94a7858ea029126c3bc913d102";s:10:"translated";N;s:8:"original";s:29:"View &#8220;%s&#8221; archive";s:15:"gettext_context";s:0:"";}i:437;O:8:"stdClass":6:{s:2:"id";s:5:"13448";s:6:"status";N;s:3:"ctx";s:32:"d2b179ab17c9cdbeccc529fea9142529";s:10:"translated";N;s:8:"original";s:5:"Note:";s:15:"gettext_context";s:0:"";}i:438;O:8:"stdClass":6:{s:2:"id";s:5:"13449";s:6:"status";N;s:3:"ctx";s:32:"7d50c82917852d811a095f3d40e076b5";s:10:"translated";N;s:8:"original";s:154:"Deleting a category does not delete the posts in that category. Instead, posts that were only assigned to the deleted category are set to the category %s.";s:15:"gettext_context";s:0:"";}i:439;O:8:"stdClass":6:{s:2:"id";s:5:"13453";s:6:"status";N;s:3:"ctx";s:32:"df93416910d6e5d402da0166617b2ee4";s:10:"translated";N;s:8:"original";s:172:"You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there&#8217;s no relationship from one tag to another.";s:15:"gettext_context";s:0:"";}i:440;O:8:"stdClass":6:{s:2:"id";s:5:"13454";s:6:"status";N;s:3:"ctx";s:32:"2c226506d0afbbba1a770a535751b268";s:10:"translated";N;s:8:"original";s:80:"When adding a new tag on this screen, you&#8217;ll fill in the following fields:";s:15:"gettext_context";s:0:"";}i:441;O:8:"stdClass":6:{s:2:"id";s:5:"13455";s:6:"status";N;s:3:"ctx";s:32:"be2d14ac9176c1c1f226ad8a7bc48aeb";s:10:"translated";N;s:8:"original";s:11:"Adding Tags";s:15:"gettext_context";s:0:"";}i:442;O:8:"stdClass":6:{s:2:"id";s:5:"13456";s:6:"status";N;s:3:"ctx";s:32:"3d21df31854ed5d4efc2cb40e7ad3b8e";s:10:"translated";N;s:8:"original";s:97:"<a href="https://codex.wordpress.org/Posts_Tags_Screen" target="_blank">Documentation on Tags</a>";s:15:"gettext_context";s:0:"";}i:443;O:8:"stdClass":6:{s:2:"id";s:5:"13457";s:6:"status";N;s:3:"ctx";s:32:"761883b480e5b96fff10e96076fcf406";s:10:"translated";N;s:8:"original";s:112:"There is an autosave of this post that is more recent than the version below. <a href="%s">View the autosave</a>";s:15:"gettext_context";s:0:"";}i:444;O:8:"stdClass":6:{s:2:"id";s:5:"13535";s:6:"status";N;s:3:"ctx";s:32:"054e0c1e1a79152711e5105dee4b047f";s:10:"translated";N;s:8:"original";s:251:"You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the Bulk Actions.";s:15:"gettext_context";s:0:"";}i:445;O:8:"stdClass":6:{s:2:"id";s:5:"13536";s:6:"status";N;s:3:"ctx";s:32:"c746a0e88169f436e9a6466942252718";s:10:"translated";N;s:8:"original";s:19:"Moderating Comments";s:15:"gettext_context";s:0:"";}i:446;O:8:"stdClass":6:{s:2:"id";s:5:"13537";s:6:"status";N;s:3:"ctx";s:32:"ccc049d33c09b521fe7ebd1dd00f5eac";s:10:"translated";N;s:8:"original";s:74:"A red bar on the left means the comment is waiting for you to moderate it.";s:15:"gettext_context";s:0:"";}i:447;O:8:"stdClass":6:{s:2:"id";s:5:"13538";s:6:"status";N;s:3:"ctx";s:32:"944f932d0423b726bd23dab71fea8505";s:10:"translated";N;s:8:"original";s:230:"In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.";s:15:"gettext_context";s:0:"";}i:448;O:8:"stdClass":6:{s:2:"id";s:5:"13539";s:6:"status";N;s:3:"ctx";s:32:"68411cf81ef029f42a0ec46594a3f9c0";s:10:"translated";N;s:8:"original";s:168:"In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.";s:15:"gettext_context";s:0:"";}i:449;O:8:"stdClass":6:{s:2:"id";s:5:"13540";s:6:"status";N;s:3:"ctx";s:32:"a0b6f98a1737347916c97d5e7392c2d6";s:10:"translated";N;s:8:"original";s:551:"In the <strong>In Response To</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.";s:15:"gettext_context";s:0:"";}i:450;O:8:"stdClass":6:{s:2:"id";s:5:"13541";s:6:"status";N;s:3:"ctx";s:32:"c7841636b76ce9101ba9cc808e1096e5";s:10:"translated";N;s:8:"original";s:185:"In the <strong>Submitted On</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.";s:15:"gettext_context";s:0:"";}i:451;O:8:"stdClass":6:{s:2:"id";s:5:"13542";s:6:"status";N;s:3:"ctx";s:32:"d87c37bfa257150ad73cd492d1558dbd";s:10:"translated";N;s:8:"original";s:129:"Many people take advantage of keyboard shortcuts to moderate their comments more quickly. Use the link to the side to learn more.";s:15:"gettext_context";s:0:"";}i:452;O:8:"stdClass":6:{s:2:"id";s:5:"13543";s:6:"status";N;s:3:"ctx";s:32:"cca51ee3eadc11a4b1562aaafb1f4a9e";s:10:"translated";N;s:8:"original";s:115:"<a href="https://codex.wordpress.org/Administration_Screens#Comments" target="_blank">Documentation on Comments</a>";s:15:"gettext_context";s:0:"";}i:453;O:8:"stdClass":6:{s:2:"id";s:5:"13544";s:6:"status";N;s:3:"ctx";s:32:"033fe3af7099a8a04e05f89e60435c6d";s:10:"translated";N;s:8:"original";s:100:"<a href="https://codex.wordpress.org/Comment_Spam" target="_blank">Documentation on Comment Spam</a>";s:15:"gettext_context";s:0:"";}i:454;O:8:"stdClass":6:{s:2:"id";s:5:"13545";s:6:"status"