pplication by thousands of developers all over the world. All plugins in the official <a href="%s" target="_blank">WordPress Plugin Directory</a> are compatible with the license WordPress uses.";s:15:"gettext_context";s:0:"";}i:596;O:8:"stdClass":6:{s:2:"id";s:5:"13918";s:6:"status";N;s:3:"ctx";s:32:"f21a09c0e4a3b3eee841ef6b410151fa";s:10:"translated";N;s:8:"original";s:114:"You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.";s:15:"gettext_context";s:0:"";}i:597;O:8:"stdClass":6:{s:2:"id";s:5:"13919";s:6:"status";N;s:3:"ctx";s:32:"f55ea180d89fafcea5f6224169b61ffb";s:10:"translated";N;s:8:"original";s:14:"Adding Plugins";s:15:"gettext_context";s:0:"";}i:598;O:8:"stdClass":6:{s:2:"id";s:5:"13920";s:6:"status";N;s:3:"ctx";s:32:"2dfd3ebb5bbf8256c5c0cc8fefb8b3c8";s:10:"translated";N;s:8:"original";s:309:"If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.";s:15:"gettext_context";s:0:"";}i:599;O:8:"stdClass":6:{s:2:"id";s:5:"13921";s:6:"status";N;s:3:"ctx";s:32:"575aca988849707fdbbfd60be15902e1";s:10:"translated";N;s:8:"original";s:178:"If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.";s:15:"gettext_context";s:0:"";}i:600;O:8:"stdClass":6:{s:2:"id";s:5:"13922";s:6:"status";N;s:3:"ctx";s:32:"96e13d80dd4d210f6e818be399382890";s:10:"translated";N;s:8:"original";s:146:"You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.";s:15:"gettext_context";s:0:"";}i:601;O:8:"stdClass":6:{s:2:"id";s:5:"13923";s:6:"status";N;s:3:"ctx";s:32:"313943fe8cc1a