cial menus, a logo, custom colors, and more. Our default theme for 2017 works great in many languages, on any device, and for a wide range of users.";s:15:"gettext_context";s:0:"";}i:712;O:8:"stdClass":6:{s:2:"id";s:5:"14476";s:6:"status";N;s:3:"ctx";s:32:"914547aa8266064c5537ff9254ae91f8";s:10:"translated";N;s:8:"original";s:19:"Your Site, Your Way";s:15:"gettext_context";s:0:"";}i:713;O:8:"stdClass":6:{s:2:"id";s:5:"14477";s:6:"status";N;s:3:"ctx";s:32:"f47dd3d7bcc8f4b92a069878ac497f10";s:10:"translated";N;s:8:"original";s:190:"WordPress 4.7 adds new features to the customizer to help take you through the initial setup of a theme, with non-destructive live previews of all your changes in one uninterrupted workflow.";s:15:"gettext_context";s:0:"";}i:714;O:8:"stdClass":6:{s:2:"id";s:5:"14478";s:6:"status";N;s:3:"ctx";s:32:"f1c5f926f73e691b38808f577c378148";s:10:"translated";N;s:8:"original";s:21:"Theme Starter Content";s:15:"gettext_context";s:0:"";}i:715;O:8:"stdClass":6:{s:2:"id";s:5:"14479";s:6:"status";N;s:3:"ctx";s:32:"fa0ce0857b8edea6df2af4e27f27fd13";s:10:"translated";N;s:8:"original";s:465:"To help give you a solid base to build from, individual themes can provide starter content that appears when you go to customize your brand new site. This can range from placing a business information widget in the best location to providing a sample menu with social icon links to a static front page complete with beautiful images. Don&#8217;t worry - nothing new will appear on the live site until you&#8217;re ready to save and publish your initial theme setup.";s:15:"gettext_context";s:0:"";}i:716;O:8:"stdClass":6:{s:2:"id";s:5:"14480";s:6:"status";N;s:3:"ctx";s:32:"e8db4bf604a383b1126627bb59ed1580";s:10:"translated";N;s:8:"original";s:14:"Edit Shortcuts";s:15:"gettext_context";s:0:"";}i:717;O:8:"stdClass":6:{s:2:"id";s:5:"14481";s:6:"status";N;s:3:"ctx";s:32:"411bf4f56e6c23b215a775c2873f589e";s:10:"translated";N;s:8:"original";s:240:"Visible icons appear to show you which parts of your site can be customized while live previewing. Click on a shortcut and get straight to editing. Paired with starter content, getting started with customizing your site is faster than ever.";s:15:"gettext_context";s:0:"";}i:718;O:8:"stdClass":6:{s:2:"id";s:5:"14482";s:6:"status";N;s:3:"ctx";s:32:"d9409182fc5fbef8f5bc8e4da7767a3c";s:10:"translated";N;s:8:"original";s:13:"Video Headers";s:15:"gettext_context";s:0:"";}i:719;O:8:"stdClass":6:{s:2:"id";s:5:"14483";s:6:"status";N;s:3:"ctx";s:32:"3d8c017cfd3c5faf0bcc9c3bc2b8c8f9";s:10:"translated";N;s:8:"original";s:255:"Sometimes a big atmospheric video as a moving header image is just what you need to showcase your wares; go ahead and try it out with Twenty Seventeen. Need some video inspiration? Try searching for sites with video headers available for download and use.";s:15:"gettext_context";s:0:"";}i:720;O:8:"stdClass":6:{s:2:"id";s:5:"14484";s:6:"status";N;s:3:"ctx";s:32:"75391325f9a7b842a7241b50b9e119dd";s:10:"translated";N;s:8:"original";s:22:"Smoother Menu Building";s:15:"gettext_context";s:0:"";}i:721;O:8:"stdClass":6:{s:2:"id";s:5:"14485";s:6:"status";N;s:3:"ctx";s:32:"6512a8473950c1351069ab28b9e2066e";s:10:"translated";N;s:8:"original";s:342:"Many menus for sites contain links to the pages of your site, but what happens when you don&#8217;t have any pages yet? Now you can add new pages while building menus instead of leaving the customizer and abandoning your changes. Once you&#8217;ve published your customizations, you&#8217;ll have new pages ready for you to fill with content.";s:15:"gettext_context";s:0:"";}i:722;O:8:"stdClass":6:{s:2:"id";s:5:"14486";s:6:"status";N;s:3:"ctx";s:32:"3e8f1db5c0d660831405254084d2823f";s:10:"translated";N;s:8:"original";s:251:"Sometimes you just need a few visual tweaks to make your site perfect. WordPress 4.7 allows you to add custom CSS and instantly see how your changes affect your site. The live preview allows you to work quickly without page refreshes slowing you down.";s:15:"gettext_context";s:0:"";}i:723;O:8:"stdClass":6:{s:2:"id";s:5:"14487";s:6:"status";N;s:3:"ctx";s:32:"9f478e8deed561051d1484104c51b9ce";s:10:"translated";N;s:8:"original";s:22:"PDF Thumbnail Previews";s:15:"gettext_context";s:0:"";}i:724;O:8:"stdClass":6:{s:2:"id";s:5:"14488";s:6:"status";N;s:3:"ctx";s:32:"ab31fa673d57127dabad6fe5482ff740";s:10:"translated";N;s:8:"original";s:172:"Managing your document collection is easier with WordPress 4.7. Uploading PDFs will generate thumbnail images so you can more easily distinguish between all your documents.";s:15:"gettext_context";s:0:"";}i:725;O:8:"stdClass":6:{s:2:"id";s:5:"14489";s:6:"status";N;s:3:"ctx";s:32:"1155febc782869a20fd230e4403e9d47";s:10:"translated";N;s:8:"original";s:26:"Dashboard in your language";s:15:"gettext_context";s:0:"";}i:726;O:8:"stdClass":6:{s:2:"id";s:5:"14490";s:6:"status";N;s:3:"ctx";s:32:"ad2080cb675dfe14b084e744166d57de";s:10:"translated";N;s:8:"original";s:235:"Just because your site is in one language doesn&#8217;t mean that everybody helping manage it prefers that language for their admin. Add more languages to your site and a user language option will show up in your user&#8217;s profiles.";s:15:"gettext_context";s:0:"";}i:727;O:8:"stdClass":6:{s:2:"id";s:5:"14491";s:6:"status";N;s:3:"ctx";s:32:"c7813ffd94e1a82e2fb9e2ea4fad012c";s:10:"translated";N;s:8:"original";s:38:"Introducing REST API Content Endpoints";s:15:"gettext_context";s:0:"";}i:728;O:8:"stdClass":6:{s:2:"id";s:5:"14492";s:6:"status";N;s:3:"ctx";s:32:"dfce0be6f4bbceddf03ab7c1f0cd4638";s:10:"translated";N;s:8:"original";s:98:"WordPress 4.7 comes with REST API endpoints for posts, comments, terms, users, meta, and settings.";s:15:"gettext_context";s:0:"";}i:729;O:8:"stdClass":6:{s:2:"id";s:5:"14493";s:6:"status";N;s:3:"ctx";s:32:"8511f440003eb063d60cd1d666f888ee";s:10:"translated";N;s:8:"original";s:328:"Content endpoints provide machine-readable external access to your WordPress site with a clear, standards-driven interface, paving the way for new and innovative methods of interacting with sites through plugins, themes, apps, and beyond. Ready to get started with development? <a href="%s">Check out the REST API reference.</a>";s:15:"gettext_context";s:0:"";}i:730;O:8:"stdClass":6:{s:2:"id";s:5:"14494";s:6:"status";N;s:3:"ctx";s:32:"c6670ab0096718874a9d72491540f348";s:10:"translated";N;s:8:"original";s:32:"Even More Developer Happiness %s";s:15:"gettext_context";s:0:"";}i:731;O:8:"stdClass":6:{s:2:"id";s:5:"14495";s:6:"status";N;s:3:"ctx";s:32:"ab45ac44bfaad18b0426251d9b56eb04";s:10:"translated";N;s:8:"original";s:19:"Post Type Templates";s:15:"gettext_context";s:0:"";}i:732;O:8:"stdClass":6:{s:2:"id";s:5:"14496";s:6:"status";N;s:3:"ctx";s:32:"a35f87e775a77a8b116ea9363b2aa9b4";s:10:"translated";N;s:8:"original";s:147:"By opening up the page template functionality to all post types, theme developers have even more flexibility with the WordPress template hierarchy.";s:15:"gettext_context";s:0:"";}i:733;O:8:"stdClass":6:{s:2:"id";s:5:"14497";s:6:"status";N;s:3:"ctx";s:32:"8e099d138ce3b29763fbf0dab54fb8f4";s:10:"translated";N;s:8:"original";s:22:"More Theme API Goodies";s:15:"gettext_context";s:0:"";}i:734;O:8:"stdClass":6:{s:2:"id";s:5:"14498";s:6:"status";N;s:3:"ctx";s:32:"e94b7213a06bde195c356fda178d00cf";s:10:"translated";N;s:8:"original";s:96:"WordPress 4.7 includes <a href="%s">new functions, hooks, and behavior</a> for theme developers.";s:15:"gettext_context";s:0:"";}i:735;O:8:"stdClass":6:{s:2:"id";s:5:"14499";s:6:"status";N;s:3:"ctx";s:32:"da70194b54834d8828cb263d3fa7c9bf";s:10:"translated";N;s:8:"original";s:19:"Custom Bulk Actions";s:15:"gettext_context";s:0:"";}i:736;O:8:"stdClass":6:{s:2:"id";s:5:"14500";s:6:"status";N;s:3:"ctx";s:32:"2ac68f21a672e9e544699f8f6cc47918";s:10:"translated";N;s:8:"original";s:53:"List tables, now with more than bulk edit and delete.";s:15:"gettext_context";s:0:"";}i:737;O:8:"stdClass":6:{s:2:"id";s:5:"14501";s:6:"status";N;s:3:"ctx";s:32:"8b269880c4688af128356fff2cf83102";s:10:"translated";N;s:8:"original";s:109:"The code that lies beneath actions and filters has been overhauled and modernized, fixing bugs along the way.";s:15:"gettext_context";s:0:"";}i:738;O:8:"stdClass":6:{s:2:"id";s:5:"14502";s:6:"status";N;s:3:"ctx";s:32:"0618fd57356deecadc9f9a12ac991182";s:10:"translated";N;s:8:"original";s:25:"Settings Registration API";s:15:"gettext_context";s:0:"";}i:739;O:8:"stdClass":6:{s:2:"id";s:5:"14503";s:6:"status";N;s:3:"ctx";s:32:"ee92399c05f346442fb140f867f47557";s:10:"translated";N;s:8:"original";s:96:"%1$s <a href="%2$s">has been enhanced</a> to include type, description, and REST API visibility.";s:15:"gettext_context";s:0:"";}i:740;O:8:"stdClass":6:{s:2:"id";s:5:"14504";s:6:"status";N;s:3:"ctx";s:32:"ea78be373eefb63c77529ff86892909b";s:10:"translated";N;s:8:"original";s:20:"Customize Changesets";s:15:"gettext_context";s:0:"";}i:741;O:8:"stdClass":6:{s:2:"id";s:5:"14505";s:6:"status";N;s:3:"ctx";s:32:"6f6f3acb0449c859c8cf978d490c0a1e";s:10:"translated";N;s:8:"original";s:153:"Customize changesets make changes in the customizer persistent, like autosave drafts. They also make exciting new features like starter content possible.";s:15:"gettext_context";s:0:"";}i:742;O:8:"stdClass":6:{s:2:"id";s:5:"14506";s:6:"status";N;s:3:"ctx";s:32:"2a2b6bab5a2e3b1d61184bcc6e6e8e68";s:10:"translated";N;s:8:"original";s:34:"Return to Dashboard &rarr; Updates";s:15:"gettext_context";s:0:"";}i:743;O:8:"stdClass":6:{s:2:"id";s:5:"14507";s:6:"status";N;s:3:"ctx";s:32:"0a63d89382cd7d951f7bd084540ae67a";s:10:"translated";N;s:8:"original";s:27:"Go to Dashboard &rarr; Home";s:15:"gettext_context";s:0:"";}i:744;O:8:"stdClass":6:{s:2:"id";s:5:"14541";s:6:"status";N;s:3:"ctx";s:32:"cc3b9935eb9fc5b1d97043481a821507";s:10:"translated";N;s:8:"original";s:7:"Page %s";s:15:"gettext_context";s:0:"";}i:745;O:8:"stdClass":6:{s:2:"id";s:5:"14542";s:6:"status";N;s:3:"ctx";s:32:"918021f3c1c7333bbb985975acdf69b3";s:10:"translated";N;s:8:"original";s:380:"If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!";s:15:"gettext_context";s:0:"";}i:746;O:8:"stdClass":6:{s:2:"id";s:5:"14543";s:6:"status";N;s:3:"ctx";s:32:"9b586226e6bb056771f2640e81e62c10";s:10:"translated";N;s:8:"original";s:30:"https://wordpress.org/plugins/";s:15:"gettext_context";s:0:"";}i:747;O:8:"stdClass":6:{s:2:"id";s:5:"14544";s:6:"status";N;s:3:"ctx";s:32:"65448e067d17c95274af845171e835c1";s:10:"translated";N;s:8:"original";s:110:"<a href="https://codex.wordpress.org/Managing_Plugins#Plugin_Management">Documentation on Managing Plugins</a>";s:15:"gettext_context";s:0:"";}i:748;O:8:"stdClass":6:{s:2:"id";s:5:"14545";s:6:"status";N;s:3:"ctx";s:32:"6300886260f98fff6ad4c8c3c6d73b11";s:10:"translated";N;s:8:"original";s:59:"<a href="https://wordpress.org/support/">Support Forums</a>";s:15:"gettext_context";s:0:"";}i:749;O:8:"stdClass":6:{s:2:"id";s:5:"14546";s:6:"status";N;s:3:"ctx";s:32:"221f62ced812cc0bca571990a1b7aade";s:10:"translated";N;s:8:"original";s:36:"The plugin is at the latest version.";s:15:"gettext_context";s:0:"";}i:750;O:8:"stdClass":6:{s:2:"id";s:5:"14547";s:6:"status";N;s:3:"ctx";s:32:"254e5d141d737384e0839dc9c4ab9cf9";s:10:"translated";N;s:8:"original";s:45:"Removing the old version of the plugin&#8230;";s:15:"gettext_context";s:0:"";}i:751;O:8:"stdClass":6:{s:2:"id";s:5:"14548";s:6:"status";N;s:3:"ctx";s:32:"758dbf6c7977300e74d4de1faa6deed4";s:10:"translated";N;s:8:"original";s:32:"Could not remove the old plugin.";s:15:"gettext_context";s:0:"";}i:752;O:8:"stdClass":6:{s:2:"id";s:5:"14549";s:6:"status";N;s:3:"ctx";s:32:"23278dea3600cfa05fc606983052ca49";s:10:"translated";N;s:8:"original"